import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { FaRocket, FaCloud, FaShieldAlt, FaExpandArrowsAlt } from 'react-icons/fa';

const FeatureCard = ({ title, description, icon: Icon, color }) => {
  const [isHovered, setIsHovered] = useState(false);

  return (
    <motion.div 
      className={`bg-gray-800 bg-opacity-50 p-8 rounded-lg shadow-lg backdrop-filter backdrop-blur-sm overflow-hidden relative`}
      initial={{ opacity: 0, y: 20 }}
      whileInView={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.5 }}
      onHoverStart={() => setIsHovered(true)}
      onHoverEnd={() => setIsHovered(false)}
    >
      <motion.div 
        className="absolute inset-0 bg-gradient-to-br opacity-20"
        style={{ background: `linear-gradient(135deg, ${color}, transparent)` }}
        initial={{ scale: 0 }}
        animate={{ scale: isHovered ? 1.2 : 1 }}
        transition={{ duration: 0.3 }}
      />
      <motion.div
        initial={{ y: 0 }}
        animate={{ y: isHovered ? -10 : 0 }}
        transition={{ duration: 0.3 }}
      >
        <Icon className={`w-12 h-12 ${color} mb-6`} />
        <h3 className="text-2xl font-bold text-white mb-4">{title}</h3>
        <p className="text-gray-300">{description}</p>
      </motion.div>
      <AnimatePresence>
        {isHovered && (
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            exit={{ opacity: 0, y: 20 }}
            transition={{ duration: 0.2 }}
            className="mt-4"
          >
            <a href="#" className={`text-sm font-semibold ${color} hover:underline`}>Learn more â†’</a>
          </motion.div>
        )}
      </AnimatePresence>
    </motion.div>
  );
};

const Info2 = () => {
  const features = [
    { title: "AI Integration", description: "Seamlessly integrate AI into your workflows for smarter, faster development.", icon: FaRocket, color: "text-blue-400" },
    { title: "Cloud Optimization", description: "Optimize your cloud infrastructure for peak performance and cost-efficiency.", icon: FaCloud, color: "text-purple-400" },
    { title: "Secure Development", description: "Build with security at the forefront, ensuring robust protection at every stage.", icon: FaShieldAlt, color: "text-green-400" },
    { title: "Scalable Architecture", description: "Design systems that grow with your business, from startup to enterprise.", icon: FaExpandArrowsAlt, color: "text-pink-400" },
  ];

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-900 to-black text-white overflow-hidden py-20 px-4 sm:px-6 lg:px-8 relative">
      <div className="max-w-7xl mx-auto relative z-10">
        <motion.div
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          className="text-center mb-20"
        >
          <h2 className="text-6xl font-bold mb-6 bg-clip-text text-transparent bg-gradient-to-r from-indigo-400 via-purple-500 to-pink-500">
            Empowering Your Digital Transformation
          </h2>
          <p className="text-xl text-gray-300 max-w-3xl mx-auto">
            TokTok provides cutting-edge solutions to revolutionize your software development process. Experience the future of coding today.
          </p>
        </motion.div>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-10">
          {features.map((feature, index) => (
            <FeatureCard key={index} {...feature} />
          ))}
        </div>

        <motion.div
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          className="mt-24 text-center"
        >
          <h3 className="text-4xl font-bold mb-6 bg-clip-text text-transparent bg-gradient-to-r from-indigo-400 to-purple-500">Ready to Transform Your Development Process?</h3>
          <p className="text-xl text-gray-300 mb-10 max-w-2xl mx-auto">
            Join thousands of companies that have accelerated their growth with TokTok's innovative solutions.
          </p>
          <motion.button 
            className="bg-gradient-to-r from-indigo-600 to-purple-600 text-white px-10 py-4 rounded-full font-bold text-lg shadow-lg"
            whileHover={{ scale: 1.05, boxShadow: "0 0 20px rgba(129, 140, 248, 0.5)" }}
            whileTap={{ scale: 0.95 }}
          >
            Get Started Now
          </motion.button>
        </motion.div>
      </div>

      {/* Dynamic background elements */}
      <div className="absolute top-0 left-0 w-full h-full overflow-hidden pointer-events-none">
        {[...Array(20)].map((_, i) => (
          <motion.div
            key={i}
            className="absolute bg-indigo-500 rounded-full opacity-10"
            style={{
              width: Math.random() * 300 + 50,
              height: Math.random() * 300 + 50,
              top: `${Math.random() * 100}%`,
              left: `${Math.random() * 100}%`,
            }}
            animate={{
              y: [0, Math.random() * 100 - 50],
              opacity: [0.1, 0.3, 0.1],
            }}
            transition={{
              duration: Math.random() * 10 + 10,
              repeat: Infinity,
              repeatType: "reverse",
            }}
          />
        ))}
      </div>
    </div>
  );
};

export default Info2;
